import React from "react";

let NewLineTable = (props) => {
    let arr = []
    let data = props.data
    for (let key in data) {
        debugger
        let a = (data[key])
        if (key !== 'address') {
            arr.push(<td>{a}</td>)
        }
    }
    arr.map((e => <td key={e.id * 1024 - 1}>{e}</td>))
    return ({arr})
}

export default NewLineTable
